def attr_colorname(imgpath, tffolder, lut, savetf = True):
    img = cv2.imread(imgpath)
    h, w = img.shape[:2]
    rgb = cv2.cvtColor(img, cv2.COLOR_BGR2RGB) # read in RGB
    rgb = rgb.astype('int64') # transform to int64 so it can have values larger than 255
    rgb8 = rgb//8 # put each channel in 32 bins by dividing it by 8
    r8, g8, b8 = cv2.split(rgb8) # get arrays of R, G, B values
    one =  r8 * (32 * 32) + g8 * 32 + b8 # convert each RGB combination to one unique number, this number is key
    tf = lut[one] # get corresponding basic color; lut is an array that is similar to a dict: its index is key
    unique, counts = [list(x) for x in np.unique(tf, return_counts=True)] # count colors
    color_percents = [0] * 11 # calculate the percentages of each basic color
    for i in range(0,11):
        if i in unique:
            k = unique.index(i)
            color_percents[i] = counts[k] / (h*w)
    print('color percentages', color_percents)

    if savetf: # save the transformed image
        # create a list of RGB values of eleven colors
        # black, blue, brown, gray, green, orange, pink, purple, red, white, yellow
        l_colorrgbs = [(0, 0, 0),(0, 0, 255),(128, 102, 64),(128, 128, 128),(0, 255, 0),(255, 204, 0),
                   (255, 128, 255),(255, 0, 255),(255, 0, 0),(255, 255, 255),(255, 255, 0)]
        tfimg = np.zeros((h, w, 3), dtype = 'uint8') # create a blank image
        for i in range(0,11):
            mask = (tf == i) # create a mask (True/False)
            tfimg[mask] = l_colorrgbs[i]# assign basic color based on mask

        bgr = cv2.cvtColor(tfimg, cv2.COLOR_RGB2BGR) # transform back to BGR
        imgname = os.path.basename(imgpath)
        tfpath = os.path.join(tffolder,'colorname',imgname.replace('.jpg','.png'))
        of.create_path(tfpath) 
        cv2.imwrite(tfpath, bgr)
    return(color_percents)

def main():
    lut = color_lut()
    imgfolder = os.path.join('img all','')
    tffolder = os.path.join("img transform",'')
    resultpath = os.path.join('img result', 'colorname.txt')
    imgpaths = glob.glob(imgfolder + '*')

    for j, imgpath in enumerate(imgpaths[:]):
        print("-"*100)
        imgname = os.path.basename(imgpath)
        print(j, imgname)
        wlist = [imgname] + attr_colorname(imgpath, tffolder, lut)
        of.save_list_to_txt(wlist, resultpath)
    print("DONE"*50)

if __name__== "__main__":
    main()
